import logo from './logo.svg';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import React from 'react';
import './App.css';
import Home from '../../offshore/src/Pages/Home';


// import Home from './Pages/Home';

function App() {
  return (
    <div className="App">
      <Router>
      <Header />
       <scroll>
        <Route exact path="/">
            <Home />
        </Route>
       </scroll>
      <footer/>
      </Router>
    </div>
  );
}

export default App;
